description:
Canada / Verenigd Koninkrijk / Verenigde Staten
Actie / Misdaad
102 minuten

goed

met Jason Statham, Ryan Phillippe en Wesley Snipes

Op een ochtend vallen vijf gemaskerde mannen in Seattle een bank binnen en gijzelen de bankbedienden en klanten. Als de politie 
ter plaatse komt en de wijk afzet, wil Lorenz, de leider van de bende, alleen onderhandelen met inspecteur Quentin Conners, die 
onlangs geschorst werd na een serieuze misstap. Met tegenzin gaat Connors akkoord om weer in dienst te treden, vooral omdat hij 
nu moet samenwerken met een groentje bij de politie, inspecteur Shane Dekker.:
